function init()
{
    window.CardsDB = new Array(1500);
}

function Datacard(ID, DATA, AVAIL, SPEC, YEAR, COST, CARDS, PROTO, NATION, NAME) {
    //set on construct
    this.iUnitID = ID;
    this.sNameU = NAME;
    this.sNation = NATION;
    this.sUnitData = DATA;
    this.iaAvailability = AVAIL; //[5]
    this.sSpecDeck = SPEC;
    this.iYear = YEAR;
    this.iCost = COST;
    this.iCards = CARDS;
    this.iIsProto = PROTO;
    //set on traits
    this.iHP = "";
    this.iSize = ""; // also ECM, as :1-2-3-4-5 vsmall, small, med, big, vbig. 0,10+ is ECM
    this.iOptics = ""; // also ECM, as :1-2-3-4-5 vsmall, small, med, big, vbig, 0,10+ is ECM
    this.iSpeed = "";
    this.iRSpeed = "";
    this.iASpeed = "";
    this.iTraining = ""; // 1-2-3-4, militia, line, shock, elite,
    this.iStealth = ""; //1-2-3-4-5, poor-med-good-vgood-exc,
    this.iAutonomy = 0;
    this.iaArmor = [0, 0, 0, 0];
    //set on Weaponize
    this.W1 = [0, 0];
    this.W2 = [0, 0];
    this.W3 = [0, 0];
}

